import React from 'react';
import { HashRouter, Route, Link } from "react-router-dom";
import App from './App';
// import ReactDOM from 'react-dom';
// import './index.css';
// import * as serviceWorker from './serviceWorker';
export default () => (
    <HashRouter>
        <Route exact path="/" component={App} />
    </HashRouter>
);
